<template>
  <div class="all">
    <el-card class="singn">
      <div class="singn-top">欢迎来到李伟伟后台管理系统</div>
      <div class="frame">
        <el-form
          :model="ruleForm"
          status-icon
          :rules="rules"
          ref="ruleForm"
          label-width="100px"
          class="demo-ruleForm"
        >
          <el-form-item label="用户名称：" prop="name">
            <el-input v-model.number="ruleForm.name"></el-input>
          </el-form-item>
          <el-form-item label="密码：" prop="pass">
            <el-input type="password" v-model="ruleForm.pass" autocomplete="off"></el-input>
          </el-form-item>

          <el-form-item>
            <el-button type="primary" @click="clickr('/Sign')">立即登入</el-button>
            <el-button @click="submitForm('ruleForm')" class="immediately">立即注册</el-button>
          </el-form-item>
        </el-form>
      </div>
    </el-card>
  </div>
</template>

<script>
export default {
  data() {
    var checkAge = (rule, value, callback) => {
      if (value === "") {
        return callback(new Error("用户名不能为空"));
      } else if (/[\u4E00-\u9FA5]/g.test(value)) {
        callback(new Error("用户名不能为汉字!"));
      } else {
        callback();
      }
    };
    var validatePass = (rule, value, callback) => {
      if (value === "") {
        callback(new Error("请输入密码"));
      } else {
        if (this.ruleForm.checkPass !== "") {
          this.$refs.ruleForm.validateField("checkPass");
        }
        callback();
      }
    };

    return {
      ruleForm: {
        pass: "",
        name: ""
      },
      rules: {
        name: [
          { validator: checkAge, trigger: "blur" },
            { required: true, message: '请输入活动名称', trigger: 'blur' },
          // { Name: '/^[0-9A-Za-z.@\-\_]{6,16}$/', message: "用户名不能使用中文", trigger: "blur" }
        ],
        pass: [
          { validator: validatePass, trigger: "blur" },
            { required: true, message: '请输入活动名称', trigger: 'blur' },
          { min: 6, message: "你的密码必须超过六位数", trigger: "blur" }
        ]
      }
    };
  },
  methods: {
    submitForm(formName) {
      this.$refs[formName].validate(valid => {
        if (valid) {
          this.$axios.req('/user/register',{username: this.ruleForm.name,
           password: this.ruleForm.pass
})
          this.$message({
            type: "seccess",
            message: "欢迎来到我的世界"
          });
          localStorage.setItem(
            "name",
            this.ruleForm.name,
            "pass",
            this.ruleForm.pass
          );
          this.$router.push("/Sign");
        } else {
          console.log("error submit!!");
          return false;
        }
      });
    },
    clickr(val) {
      this.$router.push(val);
    },
    immediately() {}
  },
  mounted() {},
  watch: {},
  computed: {}
};
</script>

